window.bookSummaryJSON = "<p>Living in the White Court is not easy, and Bianca must watch her back at every turn. The risk of being discovered as a Trove is real, and becoming a blood slave is a constant threat.</p> <p>She must survive the intrigue if she is to get her revenge, but the machinations of the White Court prove too entangled for her naive approach. </p> <p>Everyone is playing their own game, and it will take more than her hard work and sacrifice to climb the ranks. But is she ready to be as ruthless as it takes?</p> <p><b>Immerse yourself in Vampire Court, an addicting fantasy series by </b><b><i>USA Today</i></b><b> best-selling author Ingrid Seymour!</b></p>"; 
